import React from 'react';
import { 
  Box, 
  Typography, 
  Button, 
  Stack, 
  Chip, 
  Avatar,
  Paper
} from '@mui/material';
import { motion } from 'framer-motion';
import { 
  ArrowLeft, 
  Shield, 
  Zap, 
  Crown,
  Star,
  TrendingUp,
  Users,
  Globe
} from 'lucide-react';

const EnhancedTierHeader = ({ 
  bundle, 
  subBundle, 
  onBackClick, 
  isDarkMode 
}) => {
  const getBundleIcon = (bundleName) => {
    const name = bundleName.toLowerCase();
    if (name.includes('defense')) return <Shield size={32} />;
    if (name.includes('public')) return <Users size={32} />;
    if (name.includes('critical')) return <TrendingUp size={32} />;
    if (name.includes('healthcare')) return <Globe size={32} />;
    return <Shield size={32} />;
  };

  const getSubBundleIcon = (subBundleName) => {
    const name = subBundleName.toLowerCase();
    if (name.includes('border')) return <Shield size={24} />;
    if (name.includes('sky')) return <Zap size={24} />;
    if (name.includes('marine')) return <Globe size={24} />;
    if (name.includes('cyber')) return <Crown size={24} />;
    return <Star size={24} />;
  };

  const headerVariants = {
    hidden: { opacity: 0, y: -30 },
    visible: { 
      opacity: 1, 
      y: 0,
      transition: {
        duration: 0.6,
        ease: "easeOut"
      }
    }
  };

  const contentVariants = {
    hidden: { opacity: 0, x: -20 },
    visible: { 
      opacity: 1, 
      x: 0,
      transition: {
        duration: 0.5,
        delay: 0.2,
        ease: "easeOut"
      }
    }
  };

  return (
    <motion.div
      variants={headerVariants}
      initial="hidden"
      animate="visible"
    >
      <Paper 
        elevation={3}
        sx={{ 
          p: 4, 
          mb: 4, 
          borderRadius: 4,
          background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
          color: 'white',
          position: 'relative',
          overflow: 'hidden'
        }}
      >
        {/* Background decorative elements */}
        <Box sx={{
          position: 'absolute',
          top: -50,
          right: -50,
          width: 200,
          height: 200,
          background: 'rgba(255,255,255,0.1)',
          borderRadius: '50%',
          zIndex: 0
        }} />
        <Box sx={{
          position: 'absolute',
          bottom: -30,
          left: -30,
          width: 150,
          height: 150,
          background: 'rgba(255,255,255,0.05)',
          borderRadius: '50%',
          zIndex: 0
        }} />

        <Box sx={{ position: 'relative', zIndex: 1 }}>
          {/* Back Button */}
          <motion.div
            variants={contentVariants}
            initial="hidden"
            animate="visible"
          >
            <Button
              variant="outlined"
              startIcon={<ArrowLeft size={20} />}
              onClick={onBackClick}
              sx={{
                mb: 3,
                color: 'white',
                borderColor: 'rgba(255,255,255,0.3)',
                '&:hover': {
                  borderColor: 'white',
                  backgroundColor: 'rgba(255,255,255,0.1)'
                }
              }}
            >
              Back to Bundles
            </Button>
          </motion.div>

          {/* Main Content */}
          <Stack spacing={3}>
            {/* Bundle Info */}
            <motion.div
              variants={contentVariants}
              initial="hidden"
              animate="visible"
              transition={{ delay: 0.3 }}
            >
              <Stack direction="row" alignItems="center" spacing={2} sx={{ mb: 2 }}>
                <Avatar
                  sx={{
                    bgcolor: 'rgba(255,255,255,0.2)',
                    width: 64,
                    height: 64,
                    backdropFilter: 'blur(10px)',
                    border: '2px solid rgba(255,255,255,0.3)'
                  }}
                >
                  {getBundleIcon(bundle.name)}
                </Avatar>
                <Box>
                  <Typography variant="h4" fontWeight="bold" sx={{ mb: 0.5 }}>
                    {bundle.name}
                  </Typography>
                  <Typography variant="body1" sx={{ opacity: 0.9 }}>
                    {bundle.description}
                  </Typography>
                </Box>
              </Stack>
            </motion.div>

            {/* Sub Bundle Info */}
            <motion.div
              variants={contentVariants}
              initial="hidden"
              animate="visible"
              transition={{ delay: 0.4 }}
            >
              <Stack direction="row" alignItems="center" spacing={2}>
                <Avatar
                  sx={{
                    bgcolor: 'rgba(255,255,255,0.15)',
                    width: 48,
                    height: 48,
                    backdropFilter: 'blur(10px)',
                    border: '1px solid rgba(255,255,255,0.2)'
                  }}
                >
                  {getSubBundleIcon(subBundle.name)}
                </Avatar>
                <Box>
                  <Typography variant="h5" fontWeight="bold" sx={{ mb: 0.5 }}>
                    {subBundle.name}
                  </Typography>
                  <Typography variant="body2" sx={{ opacity: 0.9 }}>
                    {subBundle.description}
                  </Typography>
                </Box>
              </Stack>
            </motion.div>

            {/* Highlights */}
            {bundle.highlights && (
              <motion.div
                variants={contentVariants}
                initial="hidden"
                animate="visible"
                transition={{ delay: 0.5 }}
              >
                <Stack direction="row" spacing={2} flexWrap="wrap" sx={{ mt: 2 }}>
                  {bundle.highlights.map((highlight, index) => (
                    <Chip
                      key={index}
                      label={highlight}
                      size="small"
                      sx={{
                        bgcolor: 'rgba(255,255,255,0.2)',
                        color: 'white',
                        border: '1px solid rgba(255,255,255,0.3)',
                        '&:hover': {
                          bgcolor: 'rgba(255,255,255,0.3)'
                        }
                      }}
                    />
                  ))}
                </Stack>
              </motion.div>
            )}
          </Stack>
        </Box>
      </Paper>
    </motion.div>
  );
};

export default EnhancedTierHeader;
